import React, {Component} from 'react'

class EmpleadosList extends Component {

    state = {
        empleados: [],
        empleados2: {nombre_empleado: '', apellido_empleado: '', email_empleado: '', rol_id_rol: ''}
    }

    agregarEmpleado = () => {
        fetch('http://localhost:8000/api/empleados/', {
            method: 'POST',
            headers: {'Content-Type': 'application/json'},
        })
        .then( data => data.json())
        .then(
            data => {
                console.log(data.token);
            }
        ).catch( error => console.error(error))
    }

    cargarEmpleados = () => {
        fetch('http://localhost:8000/api/empleados/', {
            method: 'GET',
            headers: {'Content-Type': 'application/json'},
        })
        .then(data => data.json())
        .then(
            data => {
                this.setState({empleados: data})
            }
        )
        .catch( error => console.error(error))
    }

    render(){
        return(
            <div>
                <h2>Empleados</h2>
                {this.state.empleados.map(empleados => {
                    return <ul key={empleados.id_empleado}>{empleados.nombre_empleado} || {empleados.apellido_empleado} || {empleados.email_empleado}</ul>
                })}
                <button onClick={this.cargarEmpleados}>Cargar empleados</button>
            </div>
        )
    }

}

export default EmpleadosList
